# https://leetcode-cn.com/problems/longest-substring-without-repeating-characters/

# @param {String} s
# @return {Integer}
def length_of_longest_substring(s)
  # 滑动窗口
  inx_start = 0
  max_sub_length = 0
  char_map = {}
  s.split('').each_with_index do |v, inx|
    unless char_map[v].nil?
      length = inx - inx_start
      max_sub_length = length if length > max_sub_length
      inx_start = char_map[v] if char_map[v] > inx_start
    end
    char_map[v] = inx + 1
    puts "start: #{inx_start}, end: #{inx}"
    puts "max: #{max_sub_length}"
  end
  length = s.length - inx_start
  max_sub_length = length if length > max_sub_length
  puts "last: #{max_sub_length}, start: #{inx_start}"
  return max_sub_length
end

